wave_r = wave_r + 0.350*( 0.60*sin(3.980*time) + 0.40*sin(11.047*time) );
wave_g = wave_g + 0.350*( 0.60*sin(0.835*time) + 0.40*sin(1.081*time) );
wave_b = wave_b + 0.350*( 0.60*sin(0.814*time) + 0.40*sin(1.011*time) );
cx = cx + 0.110*( 0.60*sin(0.374*time) + 0.40*sin(0.294*time) );
cy = cy + 0.110*( 0.60*sin(0.393*time) + 0.40*sin(0.223*time) );
dx = dx + 0.005*( 0.60*sin(0.173*time) + 0.40*sin(0.223*time) );
decay = decay - 0.01*equal(frame%20,0);
wave_x = 0.5 + 0.25*cos(time*2)/aspecty;
wave_y = 0.5 + 0.25*sin(time*2)/aspectx;

ang = time*2;
q1 = cos(ang);
q2 = sin(ang);

warp:
shader_body { 
 vec2 uv2_1;
 vec2 tmpvar_2;
 tmpvar_2.x = bass;
 tmpvar_2.y = treb;
 vec2 tmpvar_3;
 tmpvar_3 = ((texture (sampler_main, (
   mix (uv, uv_orig, vec2(-1.0, -1.0))
  + texsize.zw)).xy - 0.37) * (0.005 + (0.045 * 
   clamp ((tmpvar_2 - 1.0), 0.0, 1.0)
 )));
 uv2_1.x = (uv.x + ((tmpvar_3.x * q1) + (tmpvar_3.y * q2)));
 uv2_1.y = (uv.y + ((tmpvar_3.x * q2) - (tmpvar_3.y * q1)));
 vec4 tmpvar_4;
 tmpvar_4.w = 1.0;
 tmpvar_4.xyz = (texture (sampler_main, uv2_1).xyz - 0.004);
 ret = tmpvar_4.xyz;
}

comp:
shader_body { 
 vec4 tmpvar_1;
 tmpvar_1.w = 1.0;
 tmpvar_1.xyz = texture (sampler_main, uv).xyz;
 ret = tmpvar_1.xyz;
}

warp_hlsl:
shader_body
{
    // PAINTERLY EFFECT:
    float2 t = 0.005 + 0.045*saturate(float2(bass,treb)-1);
    float2 uv2 = uv;
    float2 delta2 = texsize.zw*float2(1,1);
    float3 blurry_color = tex2D( sampler_main, 
        lerp(uv,uv_orig,-1) + delta2 ).xyz;
    float2 v = (blurry_color.xy-0.37) * t;
      //uv2 += v;
      // instead, add a rotated version:
      uv2.x += v.x*q1 + v.y*q2;
      uv2.y += v.x*q2 - v.y*q1;

    // sample previous frame
    ret = tex2D( sampler_main, uv2 ).xyz;

    // darken over time
    ret -= 0.004;    
}

